	"script": {
		"id": "dialog_1",
		"modification": {
			"on_talk": "[swallow_event(),speech_dialog(self, 	[~Glad I caught you!
You'd better be aware of this...~],
														[~The cave that leads into the town,
has a sentry posted in it.~],
														[~Milgram's trying to seal off the town,
so no one gets in or out.~],
														[~That might have been why
he tried to take out that bridge.~],
														[~If you're thinking to go in there,
you might reconsider.~],
							              				set(level.player.animation, 'emote_confused'),
														level.player, [~Well, yeah,
I was gonna go in there.~],
							              				set(level.player.animation, 'emote_geez'),
														[~I mean, what are we gonna do,
sit on our butts here?~],
														self, [~No, no...
but I was hoping we'd go in in force.~],
							              				set(level.player.animation, 'emote_geez'),
														level.player, [~Against Milgram? Really?~],
							              				set(level.player.animation, 'emote_talk'),
														[~I mean... on paper,
that sounds like a good enough plan,~],
							              				set(level.player.animation, 'emote_talk'),
														[~but I'm gonna be a jerk here,
and poke some holes in it.~],
														self, [~Fair enough.
I'm not particularly fond of it, myself.~],
							              				set(level.player.animation, 'emote_raisedfinger'),
														level.player, [~Firstly, Milgram's got LOTS of followers.
Tons of em.  He runs an entire city.~],
							              				set(level.player.animation, 'emote_geez'),
														[~I mean, even if we armed the whole town,
they'd grossly outnumber us.~],
							              				set(level.player.animation, 'emote_talk'),
														[~Plus, they're pretty mobile, too.
Planes and such.~],
							              				set(level.player.animation, 'emote_talk'),
														[~We might get the drop on them for a bit,
but we'd get surrounded in no time.~],
							              				set(level.player.animation, 'emote_raisedfinger'),
														[~Brute force against brute force won't work.~],
							              				set(level.player.animation, 'emote_confused'),
														[~We'd be like ... 
a bull butting heads with a freight train.~],
														self, [~Yes... oh dear.
I see what you mean.~],
							              				set(level.player.animation, 'emote_geez'),
														level.player, [~There's got to be something
we can use to our advantage,
but \"numerical superiority\" isn't it.~],
							              				set(level.player.animation, 'emote_talk'),
														[~Anyways, about the cave ahead...
it's just one guy, right?~],
														self, [~To my knowledge, yes.~],
							              				set(level.player.animation, 'emote_raisedfinger'),
														level.player, [~Maybe I can talk my way around him?~],
							              				set(level.player.animation, 'emote_talk'),
														[~Worse comes to worse,
I can just run for it.  Right?~],
														self, [~I do hope so.
Good luck!~]
														
									),
									if(not level.player.vars.stored_events['berds_crevice_village_cave_speech'],
									level.player.store_event('berds_crevice_village_cave_speech',1))
									]",
			"target": "find(level.chars, 'c', c.type in ['berd_npc'])"
		}
